def json_default(obj):
    """
    Convierte a un tipo especifico
    :param obj:
    :return:
    """
    if isinstance(obj, decimal.Decimal):
        return float(obj)
    if isinstance(obj, datetime.date):
        return str(obj)
    raise TypeError


