def generar_reporte(plantilla_codigo, parametros, formato=u'pdf', request=None):
    """
    Genera el reporte a presentar con la libreria reportbro
    :param plantilla_codigo:
    :param parametros:
    :param formato:
    :param request:
    :return:
    """
    plantilla = Plantilla.objects.filter(codigo=plantilla_codigo).first()
    if not plantilla:
        return HttpResponseServerError('Codigo de Reporte no definido')
    try:
        if request:
            parametros['usuario'] = str(request.user)

        filename = '%s_' % (parametros.get('filename', 'reporte'))
        filename = filename + datetime.datetime.now().strftime("%Y%m%d%H%M%S")

        report = Report(json.loads(plantilla.definicion), parametros)
        if report.errors:
            raise ReportBroError(report.errors[0])

        if formato == u'pdf':
            report_file = report.generate_pdf()
            response = HttpResponse(
                report_file, content_type='application/pdf')
            response['Content-Disposition'] = 'inline; filename="{filename}"'.format(
                filename=filename + '.pdf')
        else:
            report_file = report.generate_xlsx()
            response = HttpResponse(
                report_file, content_type='application/vnd.openxmlformats-officedocument.spreadsheetml.sheet')
            response['Content-Disposition'] = 'inline; filename="{filename}"'.format(
                filename=filename + '.xlsx')
        return response
    except ReportBroError as ex:
        return HttpResponseServerError('Error de reporte: ' + str(ex.error))
    except Exception as ex:
        return HttpResponseServerError('Excepcion en reporte: ' + str(ex))



def html_a_pdf(request, template, context, css=None, filename="Reporte"):
    """
    Genera el reporte a presentar con la libreria weasyprint
    :param request:
    :param template: url del template
    :param context: parametros del template
    :param css: url del css
    :param filename: nombre del archivo a retornar
    :return: tipo HttpResponse
    """
    html_template = get_template(template)
    rendered_html = html_template.render(context,request).encode(encoding="UTF-8")
    if css:
        pdf_file = HTML(string=rendered_html).write_pdf(stylesheets=[CSS(css)])
    else:
        pdf_file = HTML(string=rendered_html).write_pdf()
    http_response = HttpResponse(pdf_file, content_type='application/pdf')
    http_response['Content-Disposition'] = 'filename="%s"' % filename
    return http_response